(()=>{"use strict";document.getElementById("postUsuario").addEventListener("submit",(async e=>{e.preventDefault();let t="";const a=e.target.nombre.value,n=e.target.apellido.value,s=e.target.email.value,o=e.target.asunto.value,l=e.target.mensaje.value;await fetch("http://127.0.0.1:3000/user/",{method:"POST",headers:{"Content-Type":"application/json"},body:JSON.stringify({nombre:a,apellido:n,email:s,asunto:o,mensaje:l})}).then((e=>e.json())).then((e=>{t=e.message})),document.getElementById("textoPost").innerHTML=t}))})();